import * as React from 'react';
import { Text,TextInput,View, Image,ImageBackground, StyleSheet } from 'react-native';
import { Icon,Button,Card } from 'react-native-elements'
import { Avatar, Accessory } from 'react-native-elements';


export default class Test extends React.Component {
  constructor(props){
    super(props)
    
   
    this.state = {
      cardstate:0
    }
}
  render() {

    return (
          <View style={styles.container}>
              <Card>
          <Button onPress={() => this.setState({ cardstate: 0})}></Button>
          <br/>
          <Button onPress={() => this.setState({ cardstate: 1})}></Button>
          {this.state.cardstate == 0 ? ( <RegisterScreen/> ) : ( <LoginScreen/> )}
          </Card>
            
          </View>        
        
    );
  }
}
